import React from 'react'
import styled from 'styled-components'

const Movie = ({title, release, image, overview})=>{
    return(
        <div>
            <h1>{title}</h1>
            <h2>{release}</h2>
            <img src={image} alt={title}/>
            <p>{overview}</p>

        </div>
    )
}

export default Movie
